(831, 221, '_field_11', '    &lt;div&gt;\r\n            &lt;h6&gt;NOTA&lt;/h6&gt;\r\n            &lt;p class=&quot;parrafo&quot;&gt;Reclamo(*): Disconformidad relacionada a los bienes expendidos o suministrados o a los servicios prestados.&lt;/p&gt;\r\n            &lt;p class=&quot;parrafo&quot;&gt;Queja(*): Disconformidad que NO se encuentran relacionada a los bienes expendidos o suministrados o a los servicios prestados.&lt;/p&gt;\r\n            &lt;p class=&quot;parrafo&quot;&gt;El proveedor deberá dar respuesta al reclamo en un plazo no mayor de treinta (30) días calendario, pudiendo ampliar el plazo hasta por treinta (30) días más, previa comunicación al consumidor.&lt;/p&gt;\r\n    &lt;/div&gt;'),
(832, 221, '_field_17', '        &lt;p class=&quot;parrafo&quot;&gt;Conforme a lo establecido en el código de la Protección y Defensa del consumidor, contamos con un libro de reclamaciones a tu disposición.&lt;/p&gt;\r\n        &lt;p class=&quot;parrafo&quot;&gt;Ingresa una queja o reclamo aquí. Recuerda que los campos con un &lt;span class=&quot;obligatorio&quot;&gt; (*)&lt;/span&gt; son obligatorios&lt;/p&gt;\r\n        \r\n        &lt;div class=&quot;encabezado&quot;&gt;\r\n            &lt;div class=&quot;reclamacion&quot;&gt;Hoja de Reclamación Nº &lt;?php echo str_pad($result, 6, &quot;0&quot;, STR_PAD_LEFT); ?&gt;&lt;/div&gt;\r\n            &lt;div&gt;&lt;span class=&quot;fechatxt&quot;&gt;Fecha de reclamo o queja:&lt;/span&gt; &lt;?php echo &#039;&lt;span class=&quot;fecha&quot;&gt;&#039;. $hoy .&#039;&lt;/span&gt;&#039;;?&gt;&lt;/div&gt;\r\n        &lt;/div&gt;'),
